            end:"2022-04-19T09:01:00",

          },
          {
            title: "Event 4",
            start: "2022-04-19T09:00:00",
            end:"2022-04-19T09:01:00",

          },
          {
            title: "Event 5",
            start: "2022-04-19T09:45:00",
            end:"2022-04-19T09:46:00",

          },
          {
            title: "Event 6",
            start: "2022-04-19T09:45:00",
            end:"2022-04-19T09:46:00",

          },
          {
            title: "Event 7",
            start: "2022-04-19T09:45:00",
            end:"2022-04-19T09:46:00",

          },
          {
            title: "Event 8",
            start: "2022-04-19T09:45:00",
            end:"2022-04-19T09:46:00",

          },
          {
            title: "Event 9",
            start: "2022-04-19T09:45:00",
            end:"2022-04-19T09:46:00",

          },
          {
            title: "Event 10",
            start: "2022-04-19T09:45:00",
            end:"2022-04-19T09:46:00",

          }
        ]}
      />):(<img className='bg-image' src={DefaultImage} alt="Default Home Page" />)}
    </div>
  );
}

export default Home;
